const SongList= ()=>{

    
    return (
        <div className="book-list"> 
            <h1>Song List </h1>
            <ul className="book-list">
                <li>Jazz in the moon</li>
                <li>Love in the sky</li>

            </ul>
        </div>
     )
}

export default SongList
